import { setGlobal, addCallback, useState, useGlobal, useEffect } from 'reactn'
import axios from "axios"

const SongList = ({arraysLists, noteLength, instrumentLists, setCopyArraysLists, setCopyNoteLength, setCopyInstrumentLists }) => {
    const [token, setToken] = useGlobal("token")
    const [newSong, setNewSong] = useGlobal("newSong")
    const [song, setSong] = useState('')
    const [notes, setNotes] = useGlobal("notes")

    useEffect(() => {
        axios.get("http://localhost:1337/song/")
            .then(res => {
                setSong(res.data)
                return res
            })
            .then(res => console.log('NOWWWWWW',res.data))
    }, [])


    const saveSong = () => {
        console.log("ARRAYS")
        console.log(token)
        console.log(arraysLists)
        console.log(noteLength)
        console.log("IL", instrumentLists)
        try{
          axios.post("http://localhost:1337/song/", {
            songName: "UISong6",
            user: "629845e4c1fe79a6d09a4117",
            notes: arraysLists,
            noteLength: noteLength,
            instruments: instrumentLists,
          },
          {
            headers: {
              "Authorization": `Bearer ${token}`
            }
          })
        }
        catch (err){
          return "Invalid song info"
        }
      }

      const loadSong = () => {
        setNewSong(true)
        console.log("NS",newSong)
        console.log("ARRAYS")
        console.log(token)
        console.log(arraysLists)
        console.log(noteLength)
        console.log("IL", instrumentLists)
        try{
            axios.get("http://localhost:1337/song/UISong6/")
            .then(res => {
                setCopyArraysLists(res.data.notes)
                setCopyNoteLength(res.data.noteLength)
                setCopyInstrumentLists(res.data.instruments)
            })

        }
        catch (err){
          return "Invalid song info"
        }
    
      }

    


  return (
    <>
        <button onClick={saveSong}>Save Song</button>
        <button onClick={loadSong}>load Song</button>
    </>
  )
}

export default SongList
